$('.items').slick({
  infinite: true,
  slidesToShow: 1,
  slidesToScroll: 1,
  nextArrow: '<button class="slick-next slick-arrow icofont-double-right"></button>',
  prevArrow: '<button class="slick-prev slick-arrow icofont-double-left"></button>',
  asNavFor: '.multiple-items',
  arrows: false,
  dots: false,
  responsive: [
    {
      breakpoint: 991,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false
      }
    },
    {
      breakpoint: 480,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        autoplay: true,
        dots: false,
        autoplaySpeed: 3000,
      }
    }
  ]
});

$('.multiple-items').slick({
  slidesToShow: 3,
  slidesToScroll: 1,
  arrows: false,
  dots: false,
  asNavFor: '.items',
  dots: true,
  focusOnSelect: true,
  responsive: [
    {
      breakpoint: 991,
      settings: {
        slidesToShow: 2,
        slidesToScroll: 2,
        arrows: false
      }
    },
    {
      breakpoint: 480,
      settings: {
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        autoPlay: true
      }
    }
  ]
});


